    private void decodeOneDay(String jsonString) {
        try {
            JSONObject flurryInfoJsonObject = new JSONObject(jsonString);
            JSONObject results = flurryInfoJsonObject.optJSONObject("results");
            JSONArray jsonArray = results.getJSONArray("country_stats");
            List<Data>datas = getDatas(jsonArray);
            Collections.sort(datas, new Comparator<Data>() {
                @Override
                public int compare(Data lhs, Data rhs) {
                    if (lhs.impression > rhs.impression) {
                        return -1;
                    } else if (lhs.impression < rhs.impression) {
                        return 1;
                    } else {
                        return 0;
                    }
                }
            });

            String result = "";

            for (int i = 0; i < datas.size(); i++) {
                result += "\n" + datas.get(i).country + "   " + datas.get(i).impression + "  " + datas.get(i).clicks + "  " + datas.get(i).revenue;

            }

            Log.i(TAG, result);


        } catch (JSONException e) {
            e.printStackTrace();
        }
    }

    private void decoDays(String jsonString) {
        try {

            JSONObject flurryInfoJsonObject = new JSONObject(jsonString);
            JSONArray results = flurryInfoJsonObject.optJSONArray("results");
            List<Data> dataMergedResult = new ArrayList<>();
            for (int i = 0; i <  results.length(); i++) {
                JSONObject oneDayDataObject = results.optJSONObject(i);
                JSONArray country_stats = oneDayDataObject.optJSONArray("country_stats");
                List<Data>datas = getDatas(country_stats);
                mergeList(dataMergedResult,datas);
            }

            Collections.sort(dataMergedResult, new Comparator<Data>() {
                @Override
                public int compare(Data lhs, Data rhs) {
                    if (lhs.impression > rhs.impression) {
                        return -1;
                    } else if (lhs.impression < rhs.impression) {
                        return 1;
                    } else {
                        return 0;
                    }
                }
            });


            String result = "";

            for (int i = 0; i < dataMergedResult.size(); i++) {
                result += "\n" + dataMergedResult.get(i).country + "   " + dataMergedResult.get(i).impression + "  " + dataMergedResult.get(i).clicks + "  " + dataMergedResult.get(i).revenue;
            }

            Log.i(TAG, result);


        } catch (JSONException e) {
            e.printStackTrace();
        }
    }

    private List<Data> getDatas(JSONArray jsonArray) {
        List<Data>datas = new ArrayList<Data>();
        for (int i = 0; i < jsonArray.length(); i++) {
            JSONObject jsonObject = jsonArray.optJSONObject(i);
            Data data = new Data();
            data.country = jsonObject.optString("country");
            data.impression = Integer.parseInt(jsonObject.optString("impressions"));
            data.clicks =  Integer.parseInt(jsonObject.optString("clicks"));
            data.revenue =  Double.parseDouble(jsonObject.optString("revenue"));
            datas.add(data);
        }
        return datas;
    }

    private void mergeList( List<Data> dataA,  List<Data> dataB) {
        for (Data data : dataB) {
            boolean isMerged = false;
            for (Data mergedData: dataA) {
                if (data.country != null && data.country.equals(mergedData.country)) {
                    mergedData.revenue += data.revenue;
                    mergedData.clicks += data.clicks;
                    mergedData.impression += data.impression;
                    isMerged = true;
                    break;
                }
            }
            if (!isMerged) {
                dataA.add(data);
            }
        }
    }

